=head1 DESCRIPTION

This object contains the log events and metadata for a Live Tail
session.

=head1 ATTRIBUTES


=head2 SessionMetadata => L<Paws::CloudWatchLogs::LiveTailSessionMetadata>

This object contains the session metadata for a Live Tail session.


=head2 SessionResults => ArrayRef[L<Paws::CloudWatchLogs::LiveTailSessionLogEvent>]

An array, where each member of the array includes the information for
one log event in the Live Tail session.

A C<sessionResults> array can include as many as 500 log events. If the
number of log events matching the request exceeds 500 per second, the
log events are sampled down to 500 log events to be included in each
C<sessionUpdate> structure.



